import React from "react";
import "./productCSS.css";
import { ProductInterface } from "./Interfaces/ProductInterface";

interface Props {
  product: ProductInterface;
}

const ProductComponent: React.FC<Props> = ({ product }) => {
  return (
    <div className="rectangle">
      <div className="img">
        <img
          className="img-fluid"
          src={`https://static.my.ge/myauto/photos/${product.photo}/thumbs/${product.car_id}_1.jpg?v=${product.photo_ver}`}
          alt={product.car_model}
        />
      </div>
      <div className="model">{product.car_model}</div>
      <div className="year">{product.prod_year} წ</div>
      <div className="details">
        <p id="1">motori{product.engine_volume}</p>
        <p id="2">garbeni{product.car_run_km} კმ</p>
        <p id="3">avtomatika{product.gear_type_id} </p>
        <p id="4">ruli{product.right_wheel} </p>
      </div>
      <div className="right-side">
        <div className="ganbajeba">{product.checked}</div>
        <div className="flagLoc">{product.location_id}</div>
        <p>{product.price} ლარიicon</p>
        <p>icons</p>
        <p>icons</p>
        <p>icons</p>
      </div>
      <div className="bottomLine">
        <p>vip</p>
        <p className="views">{product.views} ნახვა .icon 2 დღის წინ</p>
      </div>
    </div>
  );
};

export default ProductComponent;
